#include "bullet_impact.hpp"

void bullet_impact::fireGameEvent(IGameEvent* event)
{
	if (!Globals::localPlayer | !event)
		return;



	if (g_Interfaces->gameEngine->getPlayerIndex(event->GetInt("userid")) == g_Interfaces->gameEngine->getLocalPlayer() && Globals::localPlayer && Globals::localPlayer->alive())
	{
		float x = event->GetFloat("x"), y = event->GetFloat("y"), z = event->GetFloat("z");
		Globals::lastgoodimpact = Vector3(x, y, z);
		bulletImpactInfo.push_back({ g_Interfaces->globalVars->curtime, Vector3(x, y, z) , Globals::localPlayer->eyePosition(),false });
	}
	else if (g_Interfaces->gameEngine->getPlayerIndex(event->GetInt("userid")) != g_Interfaces->gameEngine->getLocalPlayer() && Globals::localPlayer) {
		float x = event->GetFloat("x"), y = event->GetFloat("y"), z = event->GetFloat("z");
		auto entity = g_Interfaces->clientEntity->GetClientEntity(g_Interfaces->gameEngine->getPlayerIndex(event->GetInt("userid")));
		if (entity->team() != Globals::localPlayer->team())
			bulletImpactInfo.push_back({ g_Interfaces->globalVars->curtime, Vector3(x, y, z) , entity->eyePosition(),true });

	}

	Globals::dequeBulletImpacts.push_back(Vector3(event->GetFloat("x"), event->GetFloat("y"), event->GetFloat("z")));
}

int bullet_impact::getEventDebugID(void)
{
	return EVENT_DEBUG_ID_INIT;
}

void bullet_impact::registerSelf()
{
	g_Interfaces->gameEvent->AddListener(this, "bullet_impact", false);
}

void bullet_impact::unRegisterSelf()
{
	g_Interfaces->gameEvent->RemoveListener(this);
}

void bullet_impact::paint(void)
{
	if (!g_Interfaces->gameEngine->inGame() || !Globals::localPlayer)
	{
		bulletImpactInfo.clear();
		return;
	}

	std::vector<BulletImpactInfo>& impacts = bulletImpactInfo;

	if (impacts.empty())
		return;


	Color tracerColorL(config->get_color("colorBulletTracerLocal"));
	Color tracerColorE(config->get_color("colorBulletTracerEnemy"));
	Color impactColor(config->get_color("colorBulletImpact"));

	if (config->get_bool("miscBulletTracerLocal") || config->get_bool("miscBulletTracerEnemy"))
	{
		for (size_t i = 0; i < impacts.size(); ++i)
		{
			auto currentImpact = impacts.at(i);



			if (config->get_bool("miscBulletTracerLocal") && !currentImpact.enemy)
			{
				BeamInfo_t beamInfo;
				/*beamInfo.m_nType = TE_BEAMPOINTS;
				beamInfo.m_pszModelName = "sprites/purplelaser1.vmt";
				beamInfo.m_nModelIndex = -1;
				beamInfo.m_flHaloScale = 0.0f;
				beamInfo.m_flLife = 5.f; //TODO: make this a slider, same as for impacts...
				beamInfo.m_flWidth = 5.f;
				beamInfo.m_flEndWidth = 3.f;
				beamInfo.m_flFadeLength = 4.0f;
				beamInfo.m_flAmplitude = 2.0f;
				beamInfo.m_flBrightness = 255.f;
				beamInfo.m_flSpeed = 0.2f;
				beamInfo.m_nStartFrame = 0;
				beamInfo.m_flFrameRate = 0.f;
				beamInfo.m_flRed = tracerColorL.r();
				beamInfo.m_flGreen = tracerColorL.g();
				beamInfo.m_flBlue = tracerColorL.b();
				beamInfo.m_nSegments = 2;
				beamInfo.m_bRenderable = true;
				beamInfo.m_nFlags = FBEAM_FADEOUT;*/
				beamInfo.m_nType = TE_BEAMPOINTS;
				beamInfo.m_pszModelName = "sprites/glow01.vmt";
				beamInfo.m_pszHaloName = "sprites/glow01.vmt";
				beamInfo.m_flHaloScale = 3.0;
				beamInfo.m_flWidth = 1.5f;
				beamInfo.m_flEndWidth = 1.5f;
				beamInfo.m_flFadeLength = 0.5f;
				beamInfo.m_flAmplitude = 0;
				beamInfo.m_flBrightness = 255.f;
				beamInfo.m_flSpeed = 0.0f;
				beamInfo.m_nStartFrame = 0.0;
				beamInfo.m_flFrameRate = 0.0;
				beamInfo.m_flRed = tracerColorL.r();
				beamInfo.m_flGreen = tracerColorL.g();
				beamInfo.m_flBlue = tracerColorL.b();
				beamInfo.m_nSegments = 8;
				beamInfo.m_bRenderable = true;
				beamInfo.m_flLife = 1.5f;
				beamInfo.m_nFlags = FBEAM_ONLYNOISEONCE | FBEAM_NOTILE | FBEAM_HALOBEAM;

				beamInfo.m_vecStart = currentImpact.source;
				beamInfo.m_vecEnd = currentImpact.m_vecHitPos;


				auto beam = g_Interfaces->renderBeams->createBeamPoints(beamInfo);

				if (beam)
					g_Interfaces->renderBeams->drawBeam(beam);
			}
			else if (config->get_bool("miscBulletTracerEnemy") && currentImpact.enemy) {
				BeamInfo_t beamInfo;
				beamInfo.m_nType = TE_BEAMPOINTS;
				beamInfo.m_pszModelName = "sprites/glow01.vmt";
				beamInfo.m_pszHaloName = "sprites/glow01.vmt";
				beamInfo.m_flHaloScale = 3.0;
				beamInfo.m_flWidth = 1.5f;
				beamInfo.m_flEndWidth = 1.5f;
				beamInfo.m_flFadeLength = 0.5f;
				beamInfo.m_flAmplitude = 0;
				beamInfo.m_flBrightness = 255.f;
				beamInfo.m_flSpeed = 0.0f;
				beamInfo.m_nStartFrame = 0.0;
				beamInfo.m_flFrameRate = 0.0;
				beamInfo.m_flRed = tracerColorE.r();
				beamInfo.m_flGreen = tracerColorE.g();
				beamInfo.m_flBlue = tracerColorE.b();
				beamInfo.m_nSegments = 8;
				beamInfo.m_bRenderable = true;
				beamInfo.m_flLife = 1.5f;
				beamInfo.m_nFlags = FBEAM_ONLYNOISEONCE | FBEAM_NOTILE | FBEAM_HALOBEAM;

				beamInfo.m_vecStart = currentImpact.source;
				beamInfo.m_vecEnd = currentImpact.m_vecHitPos;


				auto beam = g_Interfaces->renderBeams->createBeamPoints(beamInfo);

				if (beam)
					g_Interfaces->renderBeams->drawBeam(beam);
			}

			if (config->get_bool("miscBulletImpact"))
				g_Interfaces->debugOverlay->addBoxOverlay(currentImpact.m_vecHitPos, Vector3(-3, -3, -3), Vector3(3, 3, 3), Vector3(0, 0, 0), impactColor.r(), impactColor.g(), impactColor.b(), impactColor.a(), 0.8f);

			impacts.erase(impacts.begin() + i);
		}
	}
}
